--
-- Name: create_pub(public.citext, point); Type: FUNCTION; Schema: ttt; Owner: postgres
--

CREATE FUNCTION ttt.create_pub(v_name public.citext, v_location point, OUT v_return uuid) RETURNS uuid
    LANGUAGE plpgsql
    AS $$

begin

    if v_name = '' then
        raise exception 'v_name input arg is empty: %', v_name;
    end if;

        ttt.pubs (
            name,
            location
        )
        values (
            v_name,
            v_location
        )
        returning id into v_return;
end;

$$;


