--
-- Name: get_highest_pubs_in_a_city(public.citext, numeric); Type: FUNCTION; Schema: ttt; Owner: postgres
--

CREATE FUNCTION ttt.get_highest_pubs_in_a_city(v_name public.citext, v_quantity numeric DEFAULT 3) RETURNS TABLE(id uuid, pub_id uuid, city_id uuid, pub_name public.citext, city_name public.citext, rating numeric, created_at timestamp with time zone, deleted_at timestamp with time zone)
    LANGUAGE plpgsql
    AS $$

begin

    if v_quantity <= 0 then
        raise exception 'v_quantity input arg must be greater than 0: %',
        v_quantity;
    end if;


    return query (
        select
            hpc.id,
            hpc.pub_id,
            hpc.city_id,
            hpc.pub_name,
            hpc.city_name,
            hpc.rating,
            hpc.created_at,
            hpc.deleted_at
        from
            ttt.get_highest_rated_pubs_with_cities(null) hpc
        where
            true
            and hpc.deleted_at is null
            and hpc.city_name = v_name
        order by
            rating desc
        limit v_quantity
    );

end;

$$;


ALTER FUNCTION ttt.get_highest_pubs_in_a_city(v_name public.citext, v_quantity numeric) OWNER TO postgres;

