--
-- Name: get_highest_rated_pubs_with_cities(numeric); Type: FUNCTION; Schema: ttt; Owner: postgres
--

CREATE FUNCTION ttt.get_highest_rated_pubs_with_cities(v_quantity numeric DEFAULT 1) RETURNS TABLE(id uuid, pub_id uuid, city_id uuid, pub_name public.citext, city_name public.citext, rating numeric, created_at timestamp with time zone, deleted_at timestamp with time zone)
    LANGUAGE plpgsql
    AS $$

begin

    if v_quantity <= 0 then
        raise exception 'v_quantity input arg must be greater than 0: %',
        v_quantity;
    end if;

    return query (
        select
            r.id,
            r.pub_id,
            _city.id as city_id,
            p.name as pub_name,
            _city.name as city_name,
            r.rating,
            r.created_at,
            r.deleted_at
        from
            ttt.pubs_reviewer_rating r
        join ttt.pubs p on p.id = r.pub_id
        left join lateral (
            select
                c.id,
                c.name
            from ttt.cities c
            where
                true
                and c.deleted_at is null
            order by
                p.location <-> c.location
            limit 1
        ) as _city on true
        where
            true
            and r.deleted_at is null
        order by
            rating desc
        limit v_quantity
    );

end;

$$;


ALTER FUNCTION ttt.get_highest_rated_pubs_with_cities(v_quantity numeric) OWNER TO postgres;

