--
-- Name: get_nearest_pubs_with_miles(point, numeric); Type: FUNCTION; Schema: ttt; Owner: postgres
--

CREATE FUNCTION ttt.get_nearest_pubs_with_miles(v_location point, v_quantity numeric DEFAULT 5) RETURNS TABLE(id uuid, name public.citext, location point, approx_miles numeric, created_at timestamp with time zone, deleted_at timestamp with time zone)
    LANGUAGE plpgsql
    AS $$

begin

    if v_quantity <= 0 then
        raise exception 'v_quantity input arg must be greater than 0: %',
        v_quantity;
    end if;


    return query (
        with _inner_pubs as (
            select
                gp.id,
                gp.name,
                gp.location,
                gp.created_at,
                gp.deleted_at
            from
                ttt.get_nearest_pubs(v_location, v_quantity) gp
        )
        select
            ip.id,
            ip.name,
            ip.location,
            (
                st_distancesphere(
                    geometry(v_location),
                    geometry(ip.location)
                ) / 1609 -- meters / 1000 = km; km * 1,609 = miles
            ) :: numeric(8, 2) as approx_miles,
            ip.created_at,
            ip.deleted_at
        from
        _inner_pubs ip
    );

end;

$$;


ALTER FUNCTION ttt.get_nearest_pubs_with_miles(v_location point, v_quantity numeric) OWNER TO postgres;

--
-- Name: get_recents_comments(public.citext, interval); Type: FUNCTION; Schema: ttt; Owner: postgres
--

CREATE FUNCTION ttt.get_recents_comments(v_pub_name public.citext, v_interval interval DEFAULT '7 days'::interval) RETURNS TABLE(id uuid, pub_id uuid, user_id uuid, username public.citext, pub_name public.citext, comment character, created_at timestamp with time zone)
    LANGUAGE plpgsql
    AS $$

declare
    v_pub_id uuid;

begin

    v_pub_id := (select p.id from ttt.pubs p where p.name = v_pub_name limit 1);

    if v_pub_id is null then
        raise exception 'v_pub_name doesnt exist: %', v_pub_name;
    end if;


    return query (
        select
            puc.id,
            puc.pub_id,
            puc.user_id,
            u.username,
            p.name as pub_name,
            puc.comment,
            puc.created_at
        from
            ttt.pubs_user_comments puc
            join ttt.users u on u.id = puc.user_id
            join ttt.pubs p on p.id = v_pub_id
        where
            true
            and puc.created_at > (now()-v_interval)
            and puc.pub_id = v_pub_id
    );

end;

$$;


