--
-- Name: store_comment(public.citext, public.citext, character); Type: FUNCTION; Schema: ttt; Owner: postgres
--

CREATE FUNCTION ttt.store_comment(v_username public.citext, v_pub_name public.citext, v_comment character, OUT v_return uuid) RETURNS uuid
    LANGUAGE plpgsql
    AS $$

declare
    v_user_id uuid;
    v_pub_id uuid;

begin

    if length(v_comment) < 10 then
        raise exception 'length of v_comment must be greater than 10: %', v_comment;
    end if;

    v_user_id := (
        select u.id 
        from ttt.users u 
        where u.username = v_username and u.deleted_at is null
    );
    v_pub_id := (
        select p.id 
        from ttt.pubs p 
        where p.name = v_pub_name and p.deleted_at is null limit 1
    );

    if v_user_id is null then
        raise exception 'v_username doesnt exist: %', v_username;
    end if;

    if v_pub_id is null then
        raise exception 'v_pub_name doesnt exist: %', v_pub_name;
    end if;


        ttt.pubs_user_comments (
            user_id,
            pub_id,
            comment
        )
        values (
            v_user_id,
            v_pub_id,
            v_comment
        )
        returning id into v_return;
end;

$$;


