--
-- Name: store_pub_rating(public.citext, numeric); Type: FUNCTION; Schema: ttt; Owner: postgres
--

CREATE FUNCTION ttt.store_pub_rating(v_name public.citext, v_rating numeric, OUT v_return uuid) RETURNS uuid
    LANGUAGE plpgsql
    AS $$

begin

    if v_name = '' then
        raise exception 'v_name input arg is empty: %', v_name;
    end if;

    if not(v_rating >= 0 and v_rating <= 100) then
        raise exception 'v_rating must be between 0 and 100: %', v_rating;
    end if;

        ttt.pubs_reviewer_rating (
            pub_id,
            rating 
        )
        (
            select
                p.id as pub_id,
                v_rating as rating
            from ttt.pubs p
                where p.name = v_name
            limit 1
        )
        returning id into v_return;

    if v_return is null then
        raise exception 'pub v_name doesnt exist: %', v_name;
    end if;

end;

$$;


