    avg(pur.rating) AS avg_rating
   FROM (ttt.pubs_user_rating pur
     JOIN ttt.pubs p ON ((p.id = pur.pub_id)))
  WHERE (true AND (pur.deleted_at IS NULL))
  GROUP BY pur.pub_id, p.name
